static inline void draw_pixel(Framebuffer* fb, unsigned int x, unsigned int y, uint32_t color)
{   
    *(uint32_t*)((uint32_t*)fb->BaseAddress + y * fb->PixelsPerScanLine + x) = color;
}

int draw_cn(Window *win, char *str, uint32_t color)
{
    uint32_t x = win->renderer->CursorPosition.x;
    uint32_t y = win->renderer->CursorPosition.y;
    uint16_t font;
    int i, j, k;
    int offset;
    for (k = 0; str[k] != 0; k += 2)
    {
        offset = ((char)(str[k] - 0xa0 - 1) * 94 +
                  ((char)(str[k + 1] - 0xa0) - 1)) *
                 32;
        for (i = 0; i < 16; i++)
        {
            font = cn_lib[offset + i * 2] << 8 |
                   cn_lib[offset + i * 2 + 1];
            for (j = 0; j < 16; j++)
                if ((font << j) & 0x8000)
                    draw_pixel(win->framebuffer,x + j,y + i,color);
        }
        x += 16;
    }
    return 0;
}